Cinnamon & Cacao Smoothie
1 cup unsweetened plant milk of choice
1/3 cup organic unsweetened soy yogurt
1 Tblsp organic chia seeds
1 Tblsp organic hemp seeds
1 Tblsp organic raw oats
1/2 tsp organic turmeric powder
2 Tblsp organic raw cacao powder
1 tsp organic Ceylon cinnamon
1 fresh organic banana
1 cup frozen organic baby spinach
1/2 frozen organic banana
Blend in Vitamix
